import React from 'react';
import {
  Card, CardBody, CardTitle, CardText, Row, Col, CardHeader,
  CardFooter, UncontrolledTooltip,
} from 'reactstrap';
import { restaurantsData } from './restaurants.js';
import Logo from './restaurant.png';
import Icon from './restaurant_1.png'

class ListRestaurants extends React.Component {
  render() {
    const filteredData = restaurantsData.slice(0, 20)
    console.log(filteredData);
    return (
      <React.Fragment>
        <div className='page-header d-flex align-items-center'>
          <div className='mr-auto'>
            <h3>Europian Restaurants</h3>
            <img  src={Logo} alt='loading...' className='img'/>
          </div>
        </div>
        <div className='page-content d-flex align-items-center justify-content-center'>
          <Card>
            <CardBody>
              {
                <Row>
                  {filteredData.map((item) => {
                    const styles = item['Cuisine Style'].replace("[", '').replace("]", '').split(', ');
                    const randomId = Math.floor((Math.random() * 10000) + 1);
                    return (
                      <Col sm='3'>
                        <Card>
                          <CardHeader style={{ background: 'burlywood' }}>
                            <CardTitle><h6>{item['Name']}</h6></CardTitle>
                            <CardText>{item['City']}</CardText>
                          </CardHeader>
                          <CardBody style={{ background: '#B3B6B7' }}>
                            {
                              <ul>
                                {styles.map((style) => {
                                  return <li><CardText>{style.replace("'", '').replace("'", '')}</CardText></li>
                                })}
                              </ul>
                            }
                          </CardBody>
                          <CardFooter>
                            <Row>
                              <Col><i className='fa fa-trophy' aria-hidden='true' id={`ranking-${item['Name']}`}>  {item['Ranking']}</i></Col>
                              <Col><i className='fa fa-star' aria-hidden='true' id={`rating-${item['Name']}`}>  {item['Rating']}</i></Col>
                              <Col><i className='fa fa-comments' aria-hidden='true' id={`review-${item['Name']}`}>  {item['Number of Reviews']}</i></Col>
                              <UncontrolledTooltip placement='bottom' target={`ranking-${item['Name']}`}>Ranking</UncontrolledTooltip>
                              <UncontrolledTooltip placement='bottom' target={`rating-${item['Name']}`}>Rating</UncontrolledTooltip>
                              <UncontrolledTooltip placement='bottom' target={`review-${item['Name']}`}>Reviews</UncontrolledTooltip>
                            </Row>
                          </CardFooter>
                        </Card>
                      </Col>
                    );
                  })
                  }
                  <hr />
                </Row>
              }
            </CardBody>
          </Card>
        </div>
      </React.Fragment>
    )
  }
}

export default ListRestaurants;
